        static void CompressAndDecompress()
        {
            //string originalString = "";
            string originalString = "zzzzzzzzzzzzz";
            actualDecimals = new List<decimal>();
            errorDecimals = new decimal[originalString.Length];

            decimal compressed = Compress(originalString);
            int[] decompressed = Decompress(compressed, originalString.Length);

            string base64Value = ConvertToBase64(decompressed);
            DisplayDifference(originalString);
            System.IO.File.WriteAllText(@"C:\Users\ebube\decompressed.txt", base64Value);
            Console.WriteLine(base64Value);
        }



        static decimal Compress(string randomString)
        {
            //remove 0 from the string
            randomString = randomString.Replace("0", "11");

            decimal total = 0;
            for (int i = 0; i < randomString.Length; i++)
            {
               
                int n = GetIntFromString(randomString[i]);
                total += n;
                actualDecimals.Add(total);

                Console.WriteLine(total);
                total = DecimalMath.Log(total, 100);
                Console.WriteLine(total);
                //if(i != randomString.Length-1) total = DecimalMath.Round(total, 20);
                Console.WriteLine(total);
                //total -= (decimal)double.Epsilon;
            }

            Console.WriteLine("Done Compressing");
            //total = DecimalMath.Round(total, 24);

            //add lenght

            return total;
        }

        static int[] Decompress(decimal seed, long totalChars = 200)
        {
            Console.WriteLine("Started Decompressing");
            int[] decompressedValue = new int[totalChars];


            for (int i = 0; i < totalChars ; i++)
            {
                //decimal sLog = DecimalMath.Pow(10, seed);
                //sLog *= sLog;
                decimal uLog = DecimalMath.Pow(100, seed);
                //decimal uLog = DecimalMath.Log(DecimalMath.Pow(10, (20+1))-1)/DecimalMath.Log(2);
                //uLog = DecimalMath.Round(uLog, 20, MidpointRounding.AwayFromZero);

                errorDecimals[errorDecimals.Length - (i + 1)] = uLog;
                ///uLog = actualDecimals[actualDecimals.Count - (i + 1)];
                
                //errorFix = 0.00000000000000000001M;

                int n = (int)DecimalMath.Floor(uLog);
                Console.WriteLine(n);

                decompressedValue[totalChars - (i + 1)] = n;
                Console.WriteLine(uLog);
                Console.WriteLine($"Value: {decompressedValue[totalChars - (i + 1)]}");

                seed = uLog - n;

                Console.WriteLine(seed);
            }

        
            
            return decompressedValue;
        }

        static void DisplayDifference(string originalString)
        {
            for(int i = 0; i < originalString.Length; i++)
            {
                decimal dec = actualDecimals[i] - errorDecimals[i];
                //Console.WriteLine(errorDecimals[i]);
                Console.WriteLine($"{ originalString[i].ToString()} ===== {dec.ToString()}");
            }
        }


        static int GetFirstDigit(int i)
        {
            if (i >= 100000000) i /= 100000000;
            if (i >= 10000) i /= 10000;
            if (i >= 100) i /= 100;
            if (i >= 10) i /= 10;
            return i;
        }

        static string GetStringFromInt(int intValue)
        {
            if (intValue == 11) return "0";
            if(intValue > 9)
            {
                string strAlpha = ((char)intValue).ToString();
                return strAlpha;
            }
            else
            {
                return intValue.ToString();
            }
        }


        static int GetIntFromString(char value)
        {
            var isNumeric = int.TryParse(value.ToString(), out int n);
            n = isNumeric ? n : char.ToUpper(value);
            return n;
        }

        static decimal ALogTest(decimal num)
        {
            decimal val = DecimalMath.Pow(100, num);
            Console.WriteLine(DecimalMath.Round(val));
            return val;
        }

        static decimal LogTest(decimal num)
        {
            decimal val = DecimalMath.Log(num, 100);
            Console.WriteLine(DecimalMath.Round(val, 20));
            return val;
        }


        static string ConvertToBase64(int[] numbers)
        {
            string base64 = "";
            for(int i = 0; i < numbers.Length; i++)
            {
                base64 += GetStringFromInt(numbers[i]);
            }

            return base64;
        }



